import React from 'react';
import './Body.css';

export default function Body(rooms) {

    return (
        <div id="body">
            BODY

            <div>
                {
                    loop(rooms)
                }
            </div>
        </div>   
    )
}

function loop(rooms) {
    let html = "<div>";
    for(let num = 0; rooms.length > num; num++){
        html += ("id:" + num + "  host:" + rooms.host + "  game" + rooms.game);
    }
    html += "</div>";
    console.log(html)
    return html;
}
